window.bookSummaryJSON = "<p>It’s never a good combo to be broke and desperate. You do stupid things. Like accidentally sign your soul over to hell.</p> <p>When I interviewed for a new security job, I didn’t bat an eye that it was for a literal graveyard shift...headstones and all. I mean, at the hourly rate they were offering, who cares? I got this.</p> <p>Turns out, I’m not guarding a graveyard like I thought. It seems I’ve just walked my broke ass into protecting a gate to hell. Yeah...I don’t got this.</p> <p>Now I’m stuck in a terrifying new reality: a group of hot demons who act like I can solve all their problems, and a battle between good, evil, and balance.</p> <p>This will seriously teach me to read the fine print on help wanted ads. Good thing this job comes with a scythe. Maybe I can use it to stop them from dragging my ass into hell.</p>"; 
